  return (
    <div>
      <div>
        <Row>
          <Col>
            <Title level={2}>Danh Sách Sản Phẩm</Title>
          </Col>
          <Col>
            <Button type="primary" className="btnCreateDSSP">
              Tạo Sản Phẩm
            </Button>
          </Col>
        </Row>
      </div>
      <div></div>
      <div></div>
    </div>
  );
};

export default DoanhThu;
